import React from 'react'
import {Switch,Route} from 'react-router-dom'
import TutorialContainer from '../content/TutorialContainer'
import Environment from '../content/Environment'


const InternalPageRouting=()=>{
  return(
  <Switch>
    <Route path='/react/:topicId' component={TutorialContainer}/>
  </Switch>
  )
}

export default InternalPageRouting;
